INSERT INTO `cms_block` VALUES (1,'Pixtron Home Blogs','Pixtron-home-blogs','<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div class=\"hb-wrapper above-padding below-padding\"&gt;\r\n    &lt;div class=\"page-main\"&gt;\r\n        &lt;div class=\"page-title-main\"&gt;&lt;strong&gt;Latest Posts&lt;/strong&gt;&lt;/div&gt;\r\n        &lt;div class=\"hb-row\"&gt;\r\n            &lt;div class=\"hb-blog\"&gt;\r\n                &lt;ul id=\"hb-blogs\"&gt;\r\n                    &lt;li style=\"display: none;\"&gt;\r\n                        &lt;div class=\"hb-inner\"&gt;\r\n                            &lt;div class=\"hb-img\"&gt;\r\n                                    &lt;img src=\"{{media url=wysiwyg/450x250_2.jpg}}\" alt=\"\" /&gt;\r\n                                     &lt;span&gt; 10 Dec 2021 &lt;/span&gt;\r\n                            &lt;/div&gt;\r\n                            &lt;div class=\"hb-content\"&gt;\r\n                                &lt;h3&gt;Công nghệ mới 2021.&lt;/h3&gt;\r\n                                &lt;p&gt;Những công nghệ mới hiện nay áp dụng cho các sản phẩm máy tính laptop mà được yêu thích bởi các bạn trẻ&lt;/p&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/li&gt;trẻ\r\n                    &lt;li style=\"display: none;\"&gt;\r\n                        &lt;div class=\"hb-inner\"&gt;\r\n                            &lt;div class=\"hb-img\"&gt;\r\n                                     &lt;img src=\"{{media url=wysiwyg/450x250_3.jpg}}\" alt=\"\" /&gt;\r\n                                     &lt;span&gt; 12 Dec 2021 &lt;/span&gt;\r\n                            &lt;/div&gt;\r\n                            &lt;div class=\"hb-content\"&gt;\r\n                                &lt;h3&gt;Internet kết nối vạn vật&lt;/h3&gt;\r\n                                &lt;p&gt;Giới thiệu về internet kết nối vạn vật và những hướng đi phát triển trong tương lai&lt;/p&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/li&gt;\r\n                    &lt;li style=\"display: none;\"&gt;\r\n                        &lt;div class=\"hb-inner\"&gt;\r\n                            &lt;div class=\"hb-img\"&gt;\r\n                                     &lt;img src=\"{{media url=wysiwyg/450x250.jpg}}\" alt=\"\" /&gt;\r\n                                     &lt;span&gt; 14 Dec 2021 &lt;/span&gt;\r\n                            &lt;/div&gt;\r\n                            &lt;div class=\"hb-content\"&gt;\r\n                                &lt;h3&gt;Lưu trữ thông tin bằng các ổ cứng cầm tay&lt;/h3&gt;\r\n                                &lt;p&gt;Giới thiệu về các ổ cứng cầm tay mới, hiện đại, kiểu cách đáp ứng nhu cầu lưu trữ các loại thông tin cần thiết của người sử dụng&lt;/p&gt;\r\n\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/li&gt;\r\n                    &lt;li style=\"display: none;\"&gt;\r\n                        &lt;div class=\"hb-inner\"&gt;\r\n                            &lt;div class=\"hb-img\"&gt;\r\n                                &lt;img src=\"{{media url=wysiwyg/450x250_4.jpg}}\" alt=\"\" /&gt;\r\n                                &lt;span&gt; 05 Dec 2021 &lt;/span&gt;\r\n                            &lt;/div&gt;\r\n                            &lt;div class=\"hb-content\"&gt;\r\n                                &lt;h3&gt;Mẫu điện thoại mới&lt;/h3&gt;\r\n                                &lt;p&gt;Mấu điện thoại sang trọng mới nhất của hãng điện thoại Cphone mang tầm quốc tề thế giới sieu pro hiện đại&lt;/p&gt;\r\n\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/li&gt;\r\n                    &lt;li style=\"display: none;\"&gt;\r\n                        &lt;div class=\"hb-inner\"&gt;\r\n                            &lt;div class=\"hb-img\"&gt;\r\n                                   &lt;img src=\"{{media url=wysiwyg/450x250_5.png}}\" alt=\"\" /&gt;\r\n                                &lt;span&gt; 07 Dec 2021 &lt;/span&gt;\r\n                            &lt;/div&gt;\r\n                            &lt;div class=\"hb-content\"&gt;\r\n                                &lt;h3&gt;Giới thiệu về máy tính mới&lt;/h3&gt;\r\n                                &lt;p&gt;Dòng máy tính chơi game đời mới nhất, chiến đủ mọi loại game AAA, BBB nổi nhất hiện nay, và thông tin về cấu hình&lt;/p&gt;\r\n\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/li&gt;\r\n                &lt;/ul&gt;\r\n                &lt;script type=\"text/javascript\" xml=\"space\"&gt;\r\n                    require([\'jquery\', \'pixtronowlcarousel\'], function() {\r\n                        jQuery(document).ready(function() {\r\n                            jQuery(\"#hb-blogs\").owlCarousel({\r\n                                items: 3,\r\n                                itemsDesktop: [1198, 3],\r\n                                itemsDesktopSmall: [1023, 3],\r\n                                itemsTablet: [768, 3],\r\n                                itemsTabletSmall: [767, 2],\r\n                                itemsMobile: [479, 1],\r\n                                pagination: false,\r\n                                navigationText: [\"&lt;div class=\'left-arrow\'&gt;&lt;i class=\'fa fa-angle-left\'&gt;&lt;/i&gt;&lt;/div&gt;\", \"&lt;div class=\'right-arrow\'&gt;&lt;i class=\'fa fa-angle-right\'&gt;&lt;/div&gt;\"],\r\n                                navigation: true,\r\n                            });\r\n                            jQuery(\"#hb-blogs li\").show();\r\n                        });\r\n                    });\r\n                &lt;/script&gt;\r\n            &lt;/div&gt;\r\n        &lt;/div&gt;\r\n    &lt;/div&gt;\r\n&lt;/div&gt;</div>','2021-12-15 11:09:52','2021-12-15 20:00:04',1),(2,'Pixtron Home Testimonials','pixtron-home-testimonials','<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div class=\"hb-wrapper testmonial-back above-padding below-padding above-margin below-margin\"&gt;\r\n    &lt;div class=\"page-main\"&gt;\r\n        &lt;div class=\"page-title-main\"&gt;&lt;strong&gt;Quotes&lt;/strong&gt;&lt;/div&gt;\r\n        &lt;div class=\"hb-row\"&gt;\r\n            &lt;div class=\"hb-testimonoals\"&gt;\r\n                &lt;ul id=\"hb-testimonials\"&gt;\r\n  &lt;li style=\"display: none;\"&gt;\r\n                        &lt;div class=\"hb-inner\"&gt;\r\n                            &lt;div class=\"hb-content\"&gt;\r\n                                &lt;p&gt;Mỗi người đều có cách sống của riêng mình, chúng ta không cần phải ngưỡng mộ cuộc sống của người khác. Có người ngoài mặt tươi cười rạng rỡ nhưng ẩn trong đó là bao giọt nước mắt, lại có người nhìn có vẻ cơ cực nhưng kỳ thực họ lại đang trải qua một cuộc sống rất thoải mái. Hạnh phúc không có một đáp án chuẩn mực, niềm vui cũng không chỉ xuất phát từ một con đường. Thu lại ánh mắt ngưỡng mộ người khác và nhìn lại tâm hồn mình. Sống cuộc sống mình mong muốn chính là những ngày tháng tươi đẹp nhất, cách sống mà mình muốn mới chính là cách sống tốt nhất.&lt;/p&gt;\r\n                            &lt;/div&gt;\r\n                            &lt;div class=\"hb-image\"&gt;&lt;img src=\"{{media url=wysiwyg/100x100_2.jpg}}\" alt=\"testimonial-image\" /&gt;\r\n                                     &lt;span&gt;\r\n                                    &lt;h4&gt;Nam béo&lt;/h4&gt;\r\n                                    &lt;p&gt;Sad boy&lt;/p&gt;\r\n                                &lt;/span&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/li&gt;\r\n                    &lt;li style=\"display: none;\"&gt;\r\n                        &lt;div class=\"hb-inner\"&gt;\r\n                            &lt;div class=\"hb-content\"&gt;\r\n                                &lt;p&gt;Cuộc sống của bạn chỉ thật sự ý nghĩa và trọn vẹn khi bạn biết giữ gìn và nuôi dưỡng ước mơ, biết ghi nhận, biết tin vào những lời hứa.&lt;/p&gt;\r\n                            &lt;/div&gt;\r\n                            &lt;div class=\"hb-image\"&gt;\r\n                                    &lt;img src=\"{{media url=wysiwyg/100x100_1.png}}\" alt=\"testimonial-image\" /&gt;\r\n                                     &lt;span&gt;\r\n                                    &lt;h4&gt;Một cô nào đấy&lt;/h4&gt;\r\n                                    &lt;p&gt;Chiêm nghiệm girl&lt;/p&gt;\r\n                                &lt;/span&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/li&gt;\r\n                  \r\n                    &lt;li style=\"display: none;\"&gt;\r\n                        &lt;div class=\"hb-inner\"&gt;\r\n                            &lt;div class=\"hb-content\"&gt;\r\n                                &lt;p&gt; Trong cuộc sống, nơi nào có một người chiến thắng, nơi đó có một người thua cuộc. Nhưng người biết hi sinh vì người khác luôn luôn là người chiến thắng.&lt;/p&gt;\r\n                            &lt;/div&gt;\r\n                            &lt;div class=\"hb-image\"&gt;\r\n&lt;img src=\"{{media url=wysiwyg/100x100_3.png}}\" alt=\"testimonial-image\" /&gt;\r\n                                     &lt;span&gt;\r\n                                    &lt;h4&gt;Ai đấy được trả lương rất cao&lt;/h4&gt;\r\n                                    &lt;p&gt;Người xạo&lt;/p&gt;\r\n                                &lt;/span&gt;\r\n                            &lt;/div&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/li&gt;\r\n                &lt;/ul&gt;\r\n                &lt;script type=\"text/javascript\" xml=\"space\"&gt;\r\n                    require([\'jquery\', \'pixtronowlcarousel\'], function() {\r\n                        jQuery(document).ready(function() {\r\n                            jQuery(\"#hb-testimonials\").owlCarousel({\r\n                                items: 1,\r\n                                itemsDesktop: [1198, 1],\r\n                                itemsDesktopSmall: [1023, 1],\r\n                                itemsTablet: [768, 1],\r\n                                itemsTabletSmall: [767, 1],\r\n                                itemsMobile: [479, 1],\r\n                                pagination: false,\r\n                                navigationText: [\"&lt;div class=\'left-arrow\'&gt;&lt;i class=\'fa fa-angle-left\'&gt;&lt;/i&gt;&lt;/div&gt;\", \"&lt;div class=\'right-arrow\'&gt;&lt;i class=\'fa fa-angle-right\'&gt;&lt;/div&gt;\"],\r\n                                navigation: true,\r\n                            });\r\n                            jQuery(\"#hb-testimonials li\").show();\r\n                        });\r\n                    });\r\n                &lt;/script&gt;\r\n            &lt;/div&gt;\r\n        &lt;/div&gt;\r\n    &lt;/div&gt;\r\n&lt;/div&gt;</div>','2021-12-15 11:09:52','2021-12-15 20:40:02',1),(3,'Pixtron Home Brands','pixtron-home-brands','<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div class=\"brands-wrapper above-padding below-padding\"&gt;\r\n&lt;div class=\"page-main\"&gt;\r\n&lt;div class=\"brands-main\"&gt;\r\n&lt;ul class=\"brands-slider\"&gt;\r\n&lt;li style=\"display: none;\"&gt;&lt;a href=\"#\"&gt; &lt;img src=\"{{media url=wysiwyg/160x80_1.png}}\" alt=\"brand-image\" /&gt; &lt;/a&gt;&lt;/li&gt;\r\n&lt;li style=\"display: none;\"&gt;&lt;a href=\"#\"&gt; &lt;img src=\"{{media url=wysiwyg/160x80_2.jpg}}\" alt=\"brand-image\" /&gt; &lt;/a&gt;&lt;/li&gt;\r\n&lt;li style=\"display: none;\"&gt;&lt;a href=\"#\"&gt; &lt;img src=\"{{media url=wysiwyg/160x80_3.png}}\" alt=\"brand-image\" /&gt; &lt;/a&gt;&lt;/li&gt;\r\n&lt;li style=\"display: none;\"&gt;&lt;a href=\"#\"&gt; &lt;i