;/a&gt;&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;script type=\"text/javascript\" xml=\"space\"&gt;\r\n document.getElementById(\"weather\").onclick = function () { location.href = \"modules_weather/page/index\"; };\r\n document.getElementById(\"news\").onclick = function () { location.href = \"modules_news/page/index\"; };\r\n document.getElementById(\"exchange\").onclick = function () { location.href = \"modules_exchangerate/page/index\"; };\r\n&lt;/script&gt;\r\n\r\n</div>','2021-12-15 11:09:52','2021-12-17 16:38:47',1),(9,'Pixtron Payments Icons','pixtron-payment-icons','<span class=\"payment-icons\">\r\n    <ul>\r\n        <li><a href=\"#\"><img class=\"image-responsive middle-block\" src=\"{{media url=\"wysiwyg/paymet/americanexpress.png\"}}\" alt=\"americanexpress\" /></a></li>\r\n        <li><a href=\"#\"><img class=\"image-responsive middle-block\" src=\"{{media url=\"wysiwyg/paymet/discover.png\"}}\" alt=\"discover\" /></a></li>\r\n        <li><a href=\"#\"><img class=\"image-responsive middle-block\" src=\"{{media url=\"wysiwyg/paymet/maestro.png\"}}\" alt=\"maestro\" /></a></li>\r\n        <li><a href=\"#\"><img class=\"image-responsive middle-block\" src=\"{{media url=\"wysiwyg/paymet/master.png\"}}\" alt=\"master\" /></a></li>\r\n        <li><a href=\"#\"><img class=\"image-responsive middle-block\" src=\"{{media url=\"wysiwyg/paymet/visa.png\"}}\" alt=\"visa\" /></a></li>\r\n    </ul>\r\n</span>','2021-12-15 11:09:52','2021-12-15 11:09:52',1),(10,'Pixtron Footer Payment & Shipping','pixtron-footer-payment-shipping','<div class=\"footer-colum-title\">\n    <h3>\n        Payment & Shipping\n    </h3>\n</div>\n<div class=\"footer-column-content\">\n    <ul class=\"footer links\">\n        <li class=\"nav item\"><a href=\"#\">Terms of Use</a></li>\n        <li class=\"nav item\"><a href=\"#\">Payment Methods</a></li>\n        <li class=\"nav item\"><a href=\"#\">Shipping Guide</a></li>\n        <li class=\"nav item\"><a href=\"#\"